配置\nsecurity:\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /platform/app/extend\n      - /platform/thoughts/campaign\n      - /platform/thoughts/topic\n      - /platform/thoughts/thought\n  # 不校验白名单\n  ignore:\n    whites:\n      - /auth/code\n      - /auth/logout\n      - /auth/login\n      - /auth/binding/*\n      - /auth/social/callback\n      - /auth/register\n      - /auth/tenant/list\n      - /resource/sms/code\n      - /*/v3/api-docs\n      - /*/error\n      - /csrf\n\nspring:\n  cloud:\n    # 网关配置\n    gateway:\n      # 打印请求日志(自定义)\n      requestLog: true\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: ruoyi-auth\n          uri: lb://ruoyi-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            - StripPrefix=1\n        # 代码生成\n        - id: ruoyi-gen\n          uri: lb://ruoyi-gen\n          predicates:\n            - Path=/tool/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: ruoyi-system\n          uri: lb://ruoyi-system\n          predicates:\n            - Path=/system/**,/monitor/**\n          filters:\n            - StripPrefix=1\n        # 资源服务\n        - id: ruoyi-resource\n          uri: lb://ruoyi-resource\n          predicates:\n            - Path=/resource/**\n          filters:\n            - StripPrefix=1\n        # 演示服务\n        - id: ruoyi-demo\n          uri: lb://ruoyi-demo\n          predicates:\n            - Path=/demo/**\n          filters:\n            - StripPrefix=1\n        # MQ演示服务\n        - id: ruoyi-stream-mq\n          uri: lb://ruoyi-stream-mq\n          predicates:\n            - Path=/stream-mq/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: ruoyi-platform\n          uri: lb://ruoyi-platform\n          predicates:\n            - Path=/platform/**,/thoughts/**,/social/**\n          filters:\n            - StripPrefix=1\n\n    # sentinel 配置\n    sentinel:\n      filter:\n        enabled: false\n      # nacos配置持久化\n      datasource:\n        ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr}\n            dataId: sentinel-${spring.application.name}.json\n            groupId: ${spring.profiles.active}\n            namespace: ${spring.cloud.nacos.config.group}\n            data-type: json\n            rule-type: gw-flow\n','2c6706fd3ee0c788befe9ac45aee106f','2010-05-05 00:00:00','2023-07-23 19:05:23',NULL,'172.26.0.1','U','3001',''),(749,914,'org.dromara.resource.api.RemoteMailService:::provider:ruoyi-resource','DUBBO_GROUP','','{\"annotations\":[],\"canonicalName\":\"org.dromara.resource.api.RemoteMailService\",\"codeSource\":\"file:/F:/Workspace/ensoul-ruoyi/ensoul-admin-serv/ruoyi-api/ruoyi-api-resource/target/classes/\",\"methods\":[{\"annotations\":[],\"name\":\"send\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"void\"},{\"annotations\":[],\"name\":\"sendWithAttachment\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\",\"java.lang.String\",\"java.util.List<java.io.File>\"],\"parameters\":[],\"returnType\":\"void\"}],\"parameters\":{\"metadata-type\":\"remote\",\"interface\":\"org.dromara.resource.api.RemoteMailService\",\"application\":\"ruoyi-resource\",\"dubbo\":\"2.0.2\",\"release\":\"3.2.4\",\"anyhost\":\"true\",\"pid\":\"18060\",\"side\":\"provider\",\"executor-management-mode\":\"isolation\",\"file-cache\":\"true\",\"methods\":\"send,sendWithAttachment\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"qos.enable\":\"false\",\"generic\":\"false\",\"bind.port\":\"20880\",\"bind.ip\":\"192.168.1.35\",\"prefer.serialization\":\"fastjson2,hessian2\",\"background\":\"false\",\"ipv6\":\"240e:b61:744:300:8489:ebaf:5cfb:5246\",\"dynamic\":\"true\",\"timestamp\":\"1690104854836\"},\"types\":[{